import React from "react";
import cityList from './city-weather';


function CityList(){

    return (
        <div>
          {cityList.map(city=>
                <City name={city.name}/>
          )}


        </div>
    )
}

function City({name}){
    return(
        <div>
            <h2>{name}</h2>
        </div>
    )

}

export default CityList;
